import "./Admin.css";
import {  useHistory } from "react-router-dom";


function Admin(){

    const history = useHistory();


    function handleProduct(){
        history.push("/addProduct");
    }



    return(
        <div className="  ">

            <p className="m-5 text-dark h3">Hey,Cheif welcome back</p>
            <div className=" container text-center mb-5 w-25 d-flex">
                <div className="  text-center mb-5 w-25 ">
                    <img   src="https://cdn.iview.abc.net.au/thumbs/i/ck/CK1714V_59a4b949bbec1_1280.jpg" alt=".."></img>
                    <button onClick={handleProduct} className="admin-button">Create Product</button>
                </div>

                <div className=" container text-center mb-5 w-25 ">
                    <img   src="https://cdn.iview.abc.net.au/thumbs/i/ck/CK1714V_59a4b949bbec1_1280.jpg" alt=".."></img>
                    <button onClick={handleProduct} className="admin-button">Create Product</button>
                </div>




                <div className=" container text-center mb-5 w-25 ">
                    <img   src="https://cdn.iview.abc.net.au/thumbs/i/ck/CK1714V_59a4b949bbec1_1280.jpg" alt=".."></img>
                    <button onClick={handleProduct} className="admin-button">Create Product</button>
                </div>
                <div className=" container text-center mb-5 w-25 ">               
                    <img   src="https://bibliocrunch.com/wp-content/uploads/2016/02/edit-logo.gif" alt=".."></img>
                    <button  className="admin-button">Edit or Delete</button>
                </div>
            </div>
        </div>

    );
}

export default Admin;
